import React, { Component } from 'react';
import { withRouter } from 'react-router-dom';
import { Link as RouterLink } from "react-router-dom";
import { makeStyles } from '@material-ui/core/styles';
import Link from '@material-ui/core/Link';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import Typography from '@material-ui/core/Typography';
import './Navbar.css'

class Navbar extends Component {
    constructor(props) {
        super(props);
        this.state = {classes: ''};
    }

    componentDidMount(){
        const useStyles = makeStyles((theme) => ({
            root: {
              flexGrow: 1,
            },
            menuButton: {
              marginRight: theme.spacing(2),
            },
            title: {
              flexGrow: 1,
            },
          }));
        this.state.classes = useStyles()
    }

    render() {
        return (
            <AppBar position="static">
                <Toolbar>
                    <IconButton edge="start" className={this.state.classes.menuButton} color="inherit" aria-label="menu">
                        <MenuIcon />
                    </IconButton>
                    <Typography variant="h6" className={this.state.classes.title}>
                        News
                    </Typography>
                    <Link component={RouterLink} to="/about">
                        About
                    </Link>
                    <Link component={RouterLink} to="/blog">
                        Blog
                    </Link>
                    <Link component={RouterLink} to="/tutorial">
                        Tutorial
                    </Link>
                </Toolbar>
            </AppBar>
        );
    }
}

export default withRouter(Navbar);
